import React from "react";

const tahsilat = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-4">
          <h5>Cari Seçiniz</h5>
            <select className="form-control">
                <option>Seçiniz</option>
                <option>Cari 1</option>
                <option>Cari 2</option>
                </select>
        </div>
      </div>
    </div>
  );
};

export default tahsilat;
